%[text] %[text:anchor:T_F10A6C38] # Fluorescent Micrographs Segmentation
%[text] There are different approaches for Segmenting RGB images vs Fluorescent Color Images (with multiple channels). This is why it is important to know what kind of image you are starting with
%[text] - **RGB images**: Treat all three channels as one unit. You need to collect the color information from all channels. Use the ColorThresholder App
%[text] - **Fluorescent Images**: treat each channel separately. Index out the channel and treat as a grayscale image. Combine the results   \
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] 
%%
%[text] %[text:anchor:T_843C9BCF] # Measuring Micrographs
%[text] %[text:anchor:H_FB32293F] ## Load image of an olfactory bulb
%[text] Read in the E6226-10C-R-40x.tif from the UNIT 2 data folder
clearvars
mmSetUnitDataFolder(2)
p.img = imread("E6226-10C-R-40x.tif");
%%
%[text] %[text:anchor:H_4766B780] ## Display the image
figure;
imshow(p.img)
%[text] What you are seeing is a close-up of the glomerular layer of an olfactory bulb. There are three labels here: 
%[text] - A blue nuclear stain (DAPI) which outline the two glomeruli.
%[text] - Two different axonal stains in Green and Red. The glomeruli looked filled by these stains, because there are a lot of axons synapsing onto dendrites in there (glomeruli are neuropil)
%[text] - Our target is the green blob in the bottom right corner \
%%
%[text] %[text:anchor:H_1E2E6769] ## b. Scale bar
%[text] %[text:anchor:H_F96D37D3] - The image is a 40X image. The size of a pixel in this image is 0.23 µm per pixel
%[text] - Use the **mmAddScaleBar** function to add a white, 50 µm scalebar to the bottom right corner of the image.  \
help mmAddScaleBar
%[text] %[text:anchor:H_F96D37D3] -     Be sure to display the image before calling this function
%[text] -     When you call the function notice that  a blue line has been added to the image.
%[text] -     Without resizing, drag the blue line to where you want it
%[text] -     Double click on the line when done
%[text] -     Enjoy scale bar \
%[text] 
mmAddScaleBar(gca,50,0.23,'white',2);
%[text] 
%%
%[text] %[text:anchor:H_9F2A2A96] ## c. Display channels and histogram
%[text] %[text:anchor:H_9B9041B7] use **mmShowHist** to show the image channels and their corresponding histograms 
figure %[text:anchor:H_DC77A4E7]
mmShowHist(p.img)
%[text] - is this image Brightfield or fluorescent? \
%[text] ```
%[text] 
%[text] ```
%%
%[text] ## Index out the Channels
%[text] %[text:anchor:TMP_3b72] Since the image is fluorescent, we need to index out the channels and process them separately, as if they were grayscale images. Use the function `imsplit` to index out the channels. Assign to r`.ch`, g`.ch`, and b`.ch.`
%[text] ##  

%%
%[text] %[text:anchor:H_5BE8C501] ## Process the Green channel
%[text] %[text:anchor:H_F0ED800E] 
%[text] %[text:anchor:H_40EB20E1] - Enhance the channel using the function **imadjust** (default settings) and assign to **`g.adjust`**
%[text] - Filter the image using a median filter and assign to **`g.median`**.
%[text] - display the median image \

%%
%[text] %[text:anchor:H_A82C76C9] ### Segment the green channel
%[text] %[text:anchor:H_EA46442E] - Create a  mask from the filtered green channel and assign to `g.mask`
%[text] - `Display the mask` \

%[text] 
%%
%[text] %[text:anchor:H_BB7C6639] ### Morphological Operations
%[text] Clean up `g.mask` by:
%[text] - Eliminating connected components smaller than the large blob (\>2000)
%[text] - Filling in any holes
%[text] - Display the mask by overlaying onto of the original channel \

%[text] - Your green mask should be one large blob in the bottom right corner of the image. Here is what an overlay of the green channel and the mask should look like \
%[text] ![](text:image:2b47)
%%
%[text] %[text:anchor:H_C29DC80D] ### Region Properties of the Green blob
%[text] %[text:anchor:H_7B9819CD] #### Area of the green mask
%[text] %[text:anchor:H_E3045DB2] The function **bwarea** returns the total area in pixels^2 of a mask in a binary image. Since we just have the one blob, we can skip using **regionprops** and use **bwarea** instead.
%[text] - Use **bwarea** to calculate the area of the green mask. This returns the area of the blob in pixels
%[text] - Remember, the um per pixel for the image is 0.23
%[text] - Convert the area to ${\\textrm{µm}}^2${"editStyle":"visual"}. Don't forget to square that ratio (We want the area of a pixel, not the length of its side) \
%[text] $\\textrm{area}\\;\\textrm{in}\\;\\textrm{µm}=\\textrm{area}\\;\\textrm{in}\\;{\\textrm{pixels}}^2 \\times {\\left(\\frac{0\\ldotp 23\\;\\textrm{um}}{\\textrm{px}}\\right)}^2 \\;${"editStyle":"visual"}

%[text] - Double-check your answer by using the **imtool** to measure the width and height of the green blob and estimate it's area as a square. Don't forget to multiply the width and height by µm per pixel \
%%
%[text] %[text:anchor:H_ED6C001D] ## h. Red channel
%[text] Does SAM work here?
%[text] %[text:anchor:H_99544B5B] Repeat the process to segment the red channel. You should end up with a blob that covers both glomeruli

%[text] Your red mask should look like this:
%[text] ![](text:image:6ea1)
%%
%[text] %[text:anchor:H_97A15708] ### i. Display overlay
%[text] %[text:anchor:H_20446D33] Overlay the red and green mask using **imshowpair**

%%
%[text] %[text:anchor:H_4627B384] ### j. Calculate area of overlap
%[text] %[text:anchor:H_7CFF81F2] 1. Use a logical operation to create a mask of the overlap between the red and green masks. Call this mask "maskrg"
%[text] 2. Calculate the area of maskrg in µm^2. You can use the same pixel size and equation that you used for the red mask \

%%
%[text] %[text:anchor:H_E008AC2D] #### advanced
%[text] Calculate the area of the red stain in the top glomerulus. 
%[text] 1. Using a logical operation, create a mask that contains only red mask that does NOT overlap with the green mask.
%[text] 2. Keep only the largest blob in that new mask for your calculations
%[text] 3. Calculate the area of the largest and convert to µm^2 \
%%

%%
%[text] %[text:anchor:T_9351A0A2] # SEGMENT Olfactory bulb 
%[text] In this example, we will load another image generated for SCIENCE. This image was captured from the brain of a mouse using techniques similar, but not exactly as shown here. 
%[text] The anatomy in question is the Main Olfactory bulb, which receives input the olfactory epithelium found at the back of the nose. The MOB is covered in spheres of neuropil (tangles of synaptic-dendritic connections) called glomeruli. The activation of this glomeruli can inform us on how olfactory information is encoded in the brain. In this experiment, activity was monitored by recording calcium activation using the fluorescent  dye known as Fura. 
%[text] 
%[text] %[text:anchor:T_52689580] ![](text:image:1087)![](text:image:2810)![](text:image:206b)
%%
%[text] %[text:anchor:H_52229AE4] ## Segment Image
%[text] %[text:anchor:H_5920] ### First, we'll get the file path
%[text] Select the Fura1.tiff  data folder
clearvars
clc
close all

mmSetUnitDataFolder(2)
p.img = imread("Fura1.tiff"); % read file
meta = imfinfo("Fura1.tiff") % read metadata
%[text] - inspect meta-data before proceeding
%[text] - Bit depth? \
%%
%[text] What's the maximum intensity in the image?
size(p.img)
max(p.img(:))
log2(5812)
%[text] -  Is this a 16-bit image?
%[text] - Will we be able to see anything? \
%%
%[text] %[text:anchor:H_E7D0E376] ### Display Image and  histogram
%[text] - use mmShowHist  \
mmShowHist(p.img)
%[text] - can you see why the image is very dark? \
%%
%[text] %[text:anchor:H_00C7241F] ### Should we enhance Contrast?
%[text] - adjust the image using imadjust
%[text] - display the image and histogram \
p.imga = imadjust(p.img);
figure;
mmShowHist(p.imga)
%[text] - what is good or bad about using **imadjust** for image processing? \
%%
%[text] %[text:anchor:H_A8771F90] ### Should we Normalize?
%[text] - use **mat2gray** \
p.imgn = mat2gray(p.img);
clf
mmShowHist(p.imgn)
%[text] - Are there more or less  saturated pixels? \
%[text] 
%%
%[text] %[text:anchor:H_AB453CDC] ## Segmentation
%[text] Ok, we're ready to segment. Let's review the enhance image to plan our strategy. We'll use this enhanced image  p.imga when we want to review our results
clf
imshow(p.imga)
%[text] - notice that this image has uneven illumination: the background is unevenly lit, where some of the background is almost as bright as some of the dots that we are trying to capture
%[text] - Also note we haven't overwritten ***imgn,*** we just enhanced it for display purposes \
%%
%[text] %[text:anchor:H_D7132C91] ### binarize
%[text] 
p.mask = imbinarize(p.imgn);
imshowpair(p.imga,p.mask)
%[text] The default binarization algorithm doesn't take into account the uneven background:
%[text] - create a mask using adaptive thresholding and a sensitivity of 0.02
%[text] - clean up any small noise smaller than 50 \
%%
%[text] %[text:anchor:H_F7513678] ## Preprocessing the image
%[text] Notice that we didn't capture all of the glomeruli. We can add some preprocessing steps to improve our results.
%[text] - use a median filter on the normalized image
%[text] - apply a gaussian filter on the filtered image with a sigma of 3 \
%[text] For example, we can use a median filter to help clean up some of the noise. And a gaussian blur to enhance the contrast between the dots and the background
p.medf = medfilt2(p.imgn);
p.gaussf = imgaussfilt(p.medf,3);

clf; % review filtering
tiledlayout("horizontal", TileSpacing="none")
for n=["imga" "medf" "gaussf"]
    nexttile
    imshow(p.(n))
    title(n)
end
%[text] - notice that the gaussian filtering helps smooth out some of the graininess in the original image \
%%
%[text] %[text:anchor:H_29BAA495] ### Binarize the filtered image
%[text] - use adaptive with a sensitivity of 0.1
%[text] - clean up noise smaller than 75 \
p.mask = imbinarize(p.gaussf,"adaptive","Sensitivity",0.1);
p.mask = bwareaopen(p.mask,75);
p.mask = imclearborder(p.mask);

clf;
imshowpair(p.imga,p.mask)
%[text] - works  pretty nice \
%[text] 
%%
%[text] %[text:anchor:H_9F25AF05] ### Separate touching glomeruli
%[text] - watershed: use a setting of 2, following by a setting of 1 \
mmGetWatershed(p.mask,ShowSteps=true); % remember to assign to mask after you have the right settings
%%
%[text] %[text:anchor:H_4B787A0C] ### Estimate Microns per pixel
imageViewer(p.mask)
%%
umperpx = 28/72
%[text] - remember, you should rarely have to do this \
%%
%[text] %[text:anchor:H_338EC9F7] ## REGION PROPERTIES 
rp = regionprops('table',p.mask,p.imgn,{'Area', 'Centroid', 'EquivDiameter','BoundingBox', 'Perimeter','Circularity','MeanIntensity'})
%%
%[text] %[text:anchor:H_2F360814] ### convert to um
%[text] How would you convert area to µm
rp.Area_um = rp.Area * umperpx^2
%%
%[text] How about equivalent diameter?
rp.ED_um = rp.EquivDiameter * umperpx;
%[text] - When its a line, you just multiply by umperpx \
%%
%[text] %[text:anchor:H_9D6B370A] ### Group summary
%[text] Calculate the mean area in µm^2 and mean diameter in micros
ts = groupsummary(rp,[],["mean","std"],["Area_um","ED_um"])
%%
%[text] Display boxcharts of area and equivalent diameters with the units converted to µms
figure
nexttile
boxchart(rp.Area_um)
ylabel("Area (µm^2)")

nexttile
boxchart(rp.ED_um)
ylabel("Diameter (µm)")
%%
%[text] %[text:anchor:H_9D0E4E40] ### Label all CCs with their intensities
figure;
imshowpair(p.imgn, p.mask)

for n=1:height(rp)
    xy = rp.Centroid(n,:);
    text(xy(1), xy(2), sprintf('%1.2f',rp.MeanIntensity(n)),'Color','y','FontWeight', 'bold') % adds text
end
%%
%[text] Are the Brighter dots larger?
figure
scatter(rp.Area,rp.MeanIntensity)
%%
corr(rp.Area,rp.MeanIntensity)
%%
%[text] %[text:anchor:T_566CD650] Are Brighter dots rounder?
figure;
scatter(rp.Circularity,rp.MeanIntensity)
corr(rp.Circularity,rp.MeanIntensity)
%%
%[text] %[text:anchor:T_298821D5] # Exercise: More Fun with Neurons
%[text] In this example, we use the intensity data from multiple to channels to inform our analysis. 
%%
%[text] %[text:anchor:H_1EA17015] ## Load file
%[text] You need to be in the Unit 2 data folder for this to work
clearvars
close all
clc

mmSetUnitDataFolder(2);
p.img = imread("JackiRedGreenCells.tiff");
fh = figure(Visible="on",WindowStyle="docked",ToolBar="figure");
imshow(p.img)
%[text] - You can (kind of) see that there are 3 different colors in that image \
%%
%[text] %[text:anchor:H_285905E0] ## Enhance for display
%[text] It's kind of hard to see the details. Let's use **imadjust** to enhance the contrast. This will be for display purposes only.
lowhigh = stretchlim(p.img); % quick and dirty image adjuster (adjusts all planes) 
p.imga = imadjust(p.img, lowhigh, []); % uses input from stretchlim
imshow(p.imga)
%[text] 
%[text] - Now you can see that there is information across all three channels  \
%[text] Immunohistochemical stain:
%[text] - Blue: general cytosolic stain (all neuronal cells)
%[text] - Green: Nuclear stain (for a subset of nuclei)
%[text] - Red: cytosolic stain for a subset of cells \
%[text] GOAL: Segment the red cells that have a green nucleus (not all do). Note that green and red make yellow. So, the red cells with yellow centers are what we are looking for.
%[text] STRATEGY: Threshold all three channels and use the binary masks to get the data that we want
%%
%[text] %[text:anchor:H_C8CB1615] ## Explore the channels
%[text] %[text:anchor:H_FC9D1F51] Here we use mmShowHist to see what the individual channels look like
mmShowHist(p.imga);
%[text] - notice that the dots in the green channel are a little dimmer than the dots in the other two channels. There is lower Signal to Noise in this image (meaning the positive signal is harder to differentiate from the background).  \
%%
%[text] %[text:anchor:H_80B0FC23] ## Red Channel
%[text] %[text:anchor:H_C71F6A55] ### Index out the red channel and display
%[text] Here we create a new structure, r, to organize our red channel information
r.ch = mat2gray(p.img(:,:,1)); % notice that we are inputting the original image, not the adjusted one
figure(Visible="on",WindowStyle="docked",ToolBar="figure");
imshow(imadjust(r.ch)) % notice that we are not adjusting the channel, we're just displaying it adjusted
%%
imageViewer(r.ch)
%[text] - 25 pixel diameter \
%%
cpCyto = cellpose(Model="cyto")
%%
cpCyto2 = cellpose(Model="cyto")
%%
cpNuclei = cellpose(Model="nuclei");
%%

%%
labels1 = segmentCells2D(cpCyto,r.gauss, ...
    ImageCellDiameter=averageCellDiameter, ...
    CellThreshold=cellThreshold, ...
    FlowErrorThreshold=flowThreshold);
%%
averageCellDiameter = 15;
cellThreshold = -4;
flowThreshold = 1;

labels2 = segmentCells2D(cpNuclei,b.medf, ...
    ImageCellDiameter=averageCellDiameter, ...
    CellThreshold=cellThreshold, ...
    FlowErrorThreshold=flowThreshold);

imshow(labeloverlay(b.ch,labels2))
%%
imshow(labeloverlay(r.ch,labels1))
%%
%[text] %[text:anchor:H_F16D0FB3] ### Threshold the red channel
%[text] There is some background noise. But the cells are relatively bright. 
%[text] - apply a gaussian filter
%[text] - binarize the filtered red channel
%[text] - display \
clf
r.gauss = imgaussfilt(r.ch);
r.mask = imbinarize(r.gauss);
imshow(r.mask)
%[text] - works pretty nicely
%[text] - There is some noise though. Let's clean that up \
%%
%[text] %[text:anchor:H_8679F366] ### Morphological operations - remove small noise
%[text] Ok, let's clean up the red mask by using bwareaopen with a setting of 75  pixels
clf
r.mask = bwareaopen(r.mask,75)
r.mask = imfill(r.mask,'holes');
imshowpair(imadjust(r.ch), r.mask)
%[text] - Looks pretty good
%[text] - Notice all the green dots are what we eliminated
%[text] - However, there remains some noise.
%[text] -  \
%[text] 
%%
%[text] %[text:anchor:H_3951A2E0] #### Display results
%[text] Here we overlay the red mask on the adjusted red channel
clf
tiledlayout(1,2,"TileSpacing","none")
nexttile
imshow(p.imga)
title('original image')

nexttile
imshowpair(imadjust(r.ch), r.mask)
title('red channel')
%[text] - that looks pretty good.  \
%%
%[text] %[text:anchor:H_724942D4] ## Green channel
%[text] %[text:anchor:H_F3E643A5] Onto the to segment the green channel
%[text] %[text:anchor:H_3A505C16] ### index out the green channel and display
%[text] - save channel to ***ch*** to a new green structure
%[text] - be sure to normalize the channel \
g.ch = p.img(:,:,2);
clf
imshow(imadjust(g.ch))
%[text] - this channel has more noise
%[text] - Bright patches of background noise. May be difficult to differentiate from the green dots \
%%
%[text] %[text:anchor:H_D2C47426] ### filter
%[text] %[text:anchor:H_7999F55D] Probably best to filter this image, to better increase the contrast
%[text] - apply a median filter with a neighborhood of 7X7
%[text] - display the adjusted channel and the filtered image \
g.medf = medfilt2(g.ch,[7 7]);
imshowpair(imadjust(g.ch), imadjust(g.medf),'montage')
title('green channel | filtered channel')
%[text] - notice that some of the noise in the background has been smoothed out
%[text] - The dots still look pretty bright \
%%
%[text] %[text:anchor:H_4E9D8FC2] ### Threshold
%[text] %[text:anchor:H_27383AD0] Ok, let's try to threshold
g.mask = imbinarize(g.medf);
imshowpair(g.ch, g.mask)
%[text] - that didn't work very well \
%%
%[text] %[text:anchor:H_05DBE875] #### Adjust contrast
%[text] - adapthisteq can help here
%[text] -  median filter can clean up noise.  \
g.cha = adapthisteq(g.ch);
g.medf = medfilt2(g.cha);
%%
%[text] %[text:anchor:H_124A4906] ### Now try to binarize
%[text] - Be sure to use adaptive thresholding and Adjust Sensitivity (to 0)
%[text] - Clear the borders
%[text] - Fill any holes \
g.mask = imbinarize(g.medf)
imshowpair(g.cha, g.mask)
%%
%[text] %[text:anchor:H_C871DB91] ### Estimate the size of your dots
imageViewer(p.mask)
%[text] - Again, use the ruler tool to calculate the diameter \
%%
%[text] Since our dots are basically circles, area of our dots can be estimated from the radius
%[text] $A=\\pi \*r^2${"editStyle":"visual"}
d = [7 14] % enter the diameter from imtool here
A = pi * (d/2).^2
%%
%[text] %[text:anchor:H_52073FE1] ### Morphological operations - filter by size
%[text] %[text:anchor:H_A6026E90] Instead of using an open operation such as **bwareaopen,** we need something a little more sophisticated. We want to get rid of BOTH small and large dots. The function **bwareafilt** does exactly that. The second input is the range of dot sizes that you want to keep
g.mask = bwareafilt(g.mask, [25 300]);

tiledlayout(1,2,"TileSpacing","none",Padding="tight")
nexttile
imshow(p.imga)
title('original image')

nexttile
imshowpair(g.cha, g.mask)
title('green channel mask')
%[text] - that worked pretty well
%[text] - But we still have some noise that we need to deal with. We'll tackle that after the next step \
%%
%[text] %[text:anchor:H_5D53FF51] ## Threshold the Blue channel
%[text] %[text:anchor:H_8EE08BC9] Next, we need to segment the blue channel
%[text] %[text:anchor:H_D78A7F1E] ### index and display
b.ch = mat2gray(p.img(:,:,3));
clf
imshow(imadjust(b.ch))
%[text] - The signal looks a little messy. Probably best if we filter first and then try the binarization step \
%%
%[text] %[text:anchor:H_E212F571] ### Filter and binarize
%[text] %[text:anchor:H_38934581] - apply **adapthhisteq** to the blue channel
%[text] - apply a median filter
%[text] -  **imbinarize** \
b.cha = adapthisteq(b.ch);
b.medf = medfilt2(b.cha);
b.mask = imbinarize(b.medf);

imshowpair(b.cha, b.mask);
%[text] - that worked really well
%[text] - No need to troubleshoot \
%%
%[text] ### Cellpose - Automated Nuclei segmentator to capture individual nuclei
%[text] Cellpose is a machine learning model specifically designed to model biological structures like cytoplasm and nuclei. Here use the Nuclei to capture all of the nuclei from the image
cpNuclei = cellpose(Model="nuclei",ModelFolder=fullfile(matlabdrive,"MtMdata","unit2","cellposeModels"));

averageCellDiameter = 15;
cellThreshold = -4; % from -6 to 6: the lower the value, the more segmentations found
flowThreshold = 1; % from 

labels2 = segmentCells2D(cpNuclei,b.medf, ...
    ImageCellDiameter=averageCellDiameter, ...
    CellThreshold=cellThreshold, ...
    FlowErrorThreshold=flowThreshold);

imshow(labeloverlay(b.ch,labels2))
%[text] - each separate color in the label map is a different nuclei \
%%
%[text] The maximum label in the label map is the number of nuclei found
max(labels2(:))
%%
%[text] %[text:anchor:H_7808CB41] ## Data Analysis
%[text] %[text:anchor:H_BD024EFF] Recall our goal of finding Red cells with green Nuclei.
%[text] %[text:anchor:H_621C48F1] ### Display
%[text] %[text:anchor:H_8314A98D] First, we will display our masks as an RGB image. To do so, we need to concatenate the masks into an RGB mask using the function **cat.** Then, we will typecast that concatenated mask into a double (because **imshow** won't display rgb images if they are logical).
p.mask = im2double(cat(3, r.mask, g.mask, b.mask));

tiledlayout(1,2,"TileSpacing","none")
nexttile
imshow(p.imga)

nexttile
imshow(p.mask)
%[text] - Here we display the original image next to the combined mask
%[text] - We will use the the DAPI stain to select the cells in the red and green channels that we want to analyze
%[text] - So, we won't keep any green dots in combined mask (that means they are neurons and likely are just noise)
%[text] - We want cyan and magenta \
%[text] 
%%
%[text] %[text:anchor:H_0975EFAF] ### Eliminate green noise. 
%[text] Notice that our green noise is outside of the blue staining. The blue stain indicates the location of neuronal cells in the tissue. We only want to process green stain that is contained inside these neuronal cells and nowhere else. 
%[text] 1. Use the logical operation AND on the **b.mask** and **g.mask** and save as **p.maskGB**.
%[text] 2. Display your results by overlaying **g**.**mask** and **p**.**maskGB**, in that order.  \
p.maskGB = b.mask & g.mask;
clf
imshowpair(g.mask, p.maskGB)
%[text] - green in the image indicates all of the dots that were eliminated, which was most of our noise \
%%
%[text] %[text:anchor:H_17BAA086] ### Eliminate Red Noise
%[text] Even though the red signal was fairly strong, it is probably a good idea to restrict our analysis to only those red dots that overlap with blue stain. So, we will do the same thing that we did with the green mask:
%[text] %[text:anchor:H_FB9CA071] 1. Use a logical AND to combine the red (r.mask) and blue (b.mask) masks. Save your result as **p.maskRB**
%[text] 2. Display your results by overlaying **maskGB** and **maskRB**, in that order.  \
p.maskRB = r.mask & b.mask;
clf
imshowpair(p.maskGB,p.maskRB)
%[text] - And now we have two masks, ***maskgb*** and ***maskrb***\*,\* that we can use for our data analysis
%[text] - If you inspect the image carefully, you will see that some red cells have yellow dots in their centers and other cells do not
%[text] - We want to count both \
%%
%[text] %[text:anchor:H_A3B32620] ### Finding red cells with green nuclei
%[text] %[text:anchor:H_1F7076C6] If we simply perform a logical AND on the red and green masks, we only get the nuclei of the overlap. 
clf
tiledlayout(1,2,"TileSpacing","none")
nexttile
imshow(p.imga)

nexttile
imshowpair(p.imga,p.maskGB & p.maskRB) % only shows the overlap
%[text] - Which *could* be useful if we just want the count of the overlap
%[text] - But not if we wanted to calculate the size of red cells with green nuclei… \
%[text] 
%%
%[text] %[text:anchor:H_51ECB73E] ### Morphological reconstruction
%[text] To get around this problem, we can perform a morphological operation using the function **imreconstruct**. With this function, we can use the green mask as a marker to identify which of the cells in the red mask to keep. The syntax is very simple
p.maskRG = imreconstruct(p.maskGB, p.maskRB); % find red cells with green dots in them
imshowpair(p.maskRG,p.maskRB)
%[text] - And it works great.
%[text] - In this image, the white cells are the cells that have green nuclei. The pink cells do not \
%%
%[text] Now we can create a mask of the red cells that aren't touch by green nuclei using some simple logical operations
maskrNOTg = p.maskRB;
maskrNOTg(p.maskRG) = false; % set all TRUES in maskRG to FALSE in maskrNOTg
imshowpair(maskrNOTg, p.maskRG)
%%
%[text] An overlay the red cells with green nuclei and the green nuclei mask
imshowpair(p.maskRG, p.maskgb)
%%
%[text] %[text:anchor:H_813C7A01] ### Region properties
%[text] %[text:anchor:H_01F6F10B] We want the properties of the red cells that do  and do not have green nuclei
rp_rNOTg = regionprops("table", maskrNOTg,"basic")
rp_rgb = regionprops("table",p.maskRG,"basic")
%[text] - So, there are more cells with green nuclei than without \
%%
%[text] We can calculate the average size of these cells
mean(rp_rNOTg.Area)
mean(rp_rgb.Area)
%[text] - cells with green nuclei are slightly larger \
%%
%[text] %[text:anchor:H_7BD34A46] #### Data visualization 
%[text] %[text:anchor:H_D152B86C] We can also display the size of these cells as boxplots. Notice the function **boxchart** instead of boxplot
figure; 
tiledlayout(1,2)

nexttile
boxchart(rp_rNOTg.Area)
title('No Green Nuclei')
ylim([0 700])

nexttile
boxchart(rp_rgb.Area)
title('Green Nuclei')
ylim([0 700])
%%
rpNuc = regionprops('table',labels2,["Area" "EquivDiameter"])
%%
figure;
nexttile
histogram(rpNuc.Area)
nexttile
histogram(rpNuc.EquivDiameter)

